require "pry-byebug"
input = "".split("")

current_length = input.size
@current_string = []
chars_to_try = "abcdefghijklmnopqrstuvwxyz".split("")
shortest = 10762
def is_upper(char)
  return /[[:upper:]]/.match(char)
end
def annihilate?(a, b)
  return (a.upcase == b.upcase && ((is_upper(a) && !is_upper(b)) || (!is_upper(a) && is_upper(b))))
end
def react(input)
  pair = -1
  input.each_with_index do |a, i|
    break if i+1 >= input.size
    if (annihilate?(a, input[i+1]))
      pair = i
      break
    end
  end
  if pair != -1
    @current_string = []
    if pair != 0
      @current_string = input[0..pair-1]
    end
    if pair+2 < input.size
      @current_string.push(input[pair+2..input.size]).flatten!
    end
  end
end
def remove_chars(char, input)
  return input.join("").gsub(char.downcase, "").gsub(char.upcase, "").split("")
end

chars_to_try.each do |char|
    new_input = remove_chars(char, input)
    react(new_input)
    current_length = input.size
    while @current_string.length != current_length
      current_length = @current_string.length
      react(@current_string)
    end
    p "#{char} #{@current_string.size}"
    if @current_string.size < shortest
      shortest = @current_string.size
    end
end

p shortest


